import React from 'react';

function CreateHost() {
    return (
        <div class="container">
            <main role="main" class="pb-3">
                <div class="text-center">
                    <h1 class="display-4">Welcome</h1>
                </div>
            </main>
        </div>
    );
}

export default CreateHost;
